import{_ as p,o as a,c as e,R as t}from"./chunks/framework.-3ULgdun.js";const r="/assets/hxy.8cGErOxA.png",o="/assets/xzy.Z1IXOaDx.png",s="/assets/zb.F-0-cjZW.png",i="/assets/zzs.h2COiQJ6.png",h="/assets/zy.1_qUPYr4.png",n="/assets/lsq.j5cB2QKy.png",g=JSON.parse('{"title":"第五组","description":"","frontmatter":{},"headers":[],"relativePath":"article/group-5/index.md","filePath":"article/group-5/index.md"}'),l={name:"article/group-5/index.md"},c=t('<h1 id="第五组" tabindex="-1">第五组 <a class="header-anchor" href="#第五组" aria-label="Permalink to &quot;第五组&quot;">​</a></h1><h2 id="无题" tabindex="-1">无题 <a class="header-anchor" href="#无题" aria-label="Permalink to &quot;无题&quot;">​</a></h2><h4 id="韩欣妤" tabindex="-1"><em>韩欣妤</em> <a class="header-anchor" href="#韩欣妤" aria-label="Permalink to &quot;_韩欣妤_&quot;">​</a></h4><p>窗外有片温柔的天空，</p><p>飘忽着不定的云朵。</p><p>几抹阳光映树梢，</p><p>那里正演奏阵阵小曲。</p><p>麻雀叽喳唱它们的歌，</p><p>落在枝头，</p><p>宛如点缀自然的标点。</p><p>柘树枝上的逗号；</p><p>窗檐上的是句号；</p><p>几只一同落在电线上</p><p>是省略号……</p><p>麻雀不会翱翔，</p><p>也不会盘旋，</p><p>更不会大鸟一样直上云霄，</p><p>或于天际滑翔，</p><p>它们只在树间跳跃，</p><p>在屋檐窗下往返，</p><p>它们沐浴着平凡又温暖的阳光，</p><p>享受着不普通又温柔的微风，</p><p>与人类共存于烟火市井中。</p><p>每天忙碌着，平庸着，</p><p>也曾自卑，未曾羞愧。</p><p>瞧那天边已染上红晕</p><p>我伸手接住阳光</p><p>在布满光斑的枝头</p><p>一个逗号飞走了</p><p>只留下叶片的静……</p><p><img src="'+r+'" alt="hxy"></p><h2 id="无题-1" tabindex="-1">无题 <a class="header-anchor" href="#无题-1" aria-label="Permalink to &quot;无题&quot;">​</a></h2><h4 id="肖智煜" tabindex="-1"><em>肖智煜</em> <a class="header-anchor" href="#肖智煜" aria-label="Permalink to &quot;_肖智煜_&quot;">​</a></h4><p>假如我是一架钢琴，</p><p>我也应该用清脆的音符弹奏；</p><p>这诠释生活喜怒哀乐的五线谱，</p><p>这带有神秘色彩的休止符，</p><p>这留给人们长久记忆的乐趣，</p><p>和那来自音乐的无比神奇的力量……</p><p>——然后我笑了，</p><p>连笑声也融入在这音乐里面。</p><p>为什么我的脸常含笑容？</p><p>因为我对这音乐爱的长久……</p><p><img src="'+o+'" alt="xzy"></p><h2 id="田野" tabindex="-1">田野 <a class="header-anchor" href="#田野" aria-label="Permalink to &quot;田野&quot;">​</a></h2><h4 id="邹政皓" tabindex="-1"><em>邹政皓</em> <a class="header-anchor" href="#邹政皓" aria-label="Permalink to &quot;_邹政皓_&quot;">​</a></h4><p>当我来到这里，</p><p>这是一片棕色的田野。</p><p>那肥沃的土地上，</p><p>还住着快乐的蚯蚓。</p><p>当我生活在这里，</p><p>这是一片绿油油的田野。</p><p>那嫩绿的叶片上</p><p>有着一颗一颗的水珠。</p><p>当我离开这里，</p><p>这是一片金黄的田野。</p><p>那被夕阳所渲染的火烧云</p><p>照耀着的</p><p>是那颗颗饱满的麦粒。</p><p><img src="'+s+'" alt="zb"></p><h2 id="无题-2" tabindex="-1">无题 <a class="header-anchor" href="#无题-2" aria-label="Permalink to &quot;无题&quot;">​</a></h2><h4 id="朱子深" tabindex="-1"><em>朱子深</em> <a class="header-anchor" href="#朱子深" aria-label="Permalink to &quot;_朱子深_&quot;">​</a></h4><p>窗外，</p><p>灯火通明，</p><p>机器轰鸣，</p><p>人们欢声笑语，欢天喜地</p><p>窗外，</p><p>乌烟瘴气，</p><p>世界，一片死寂，</p><p>可谁知，</p><p>世界上最后一朵新鲜的花，</p><p>褪去满是不堪的外衣，</p><p>孤零零地，</p><p>等着死亡来临。</p><p><img src="'+i+'" alt="zzs"></p><h2 id="无题-3" tabindex="-1">无题 <a class="header-anchor" href="#无题-3" aria-label="Permalink to &quot;无题&quot;">​</a></h2><h4 id="张芸" tabindex="-1"><em>张芸</em> <a class="header-anchor" href="#张芸" aria-label="Permalink to &quot;_张芸_&quot;">​</a></h4><p>你是我无意间捕捉的风</p><p>大团大团的云挂进晃眼的蓝天</p><p>仿佛已忘却夏的酷热</p><p>你是我细雨中夹杂的清香</p><p>柔软的拂过我脸颊</p><p>飘向那清越的芦笙</p><p>我便奔向夕阳</p><p>奔向夏的尾声</p><p><img src="'+h+'" alt="zy"></p><h2 id="无题-4" tabindex="-1">无题 <a class="header-anchor" href="#无题-4" aria-label="Permalink to &quot;无题&quot;">​</a></h2><h4 id="李水清" tabindex="-1"><em>李水清</em> <a class="header-anchor" href="#李水清" aria-label="Permalink to &quot;_李水清_&quot;">​</a></h4><p>小时候</p><p>乡愁是一扇窄窄的铁门</p><p>我在这头</p><p>母亲在那头</p><p>长大后</p><p>乡愁是一串长航的手机号码</p><p>我在这头</p><p>母亲在里头</p><p>后来啊</p><p>乡愁是一扇方方的车窗</p><p>我在里头</p><p>母亲在外头</p><p>而现在</p><p>乡愁是一轮皎皎的圆月</p><p>我在这头</p><p>家在那头</p><p><img src="'+n+'" alt="lsq"></p>',105),d=[c];function _(m,u,q,b,x,f){return a(),e("div",null,d)}const k=p(l,[["render",_]]);export{g as __pageData,k as default};
